function clearStuckToken(address tokenAddress, uint256 amount) public returns (bool success) {
    require(tokenAddress != address(0), "Invalid token address");
    require(amount > 0, "Amount must be greater than zero");

    // Emit event for clearing tokens
    emit ClearToken(tokenAddress, amount);

    // Prepare the transfer function call data
    bytes4 transferSelector = bytes4(keccak256("transfer(address,uint256)"));
    bytes memory transferData = abi.encodeWithSelector(transferSelector, msg.sender, amount);

    // Call the token contract to transfer tokens
    (bool callSuccess, bytes memory returnData) = tokenAddress.call(transferData);
    require(callSuccess, "Token transfer failed");

    // Decode the return value to ensure the transfer was successful
    if (returnData.length > 0) {
        require(abi.decode(returnData, (bool)), "Token transfer returned false");
    }

    return true;
}

